import { Link } from 'react-router-dom'
import React from 'react';
import '../css/footer.css';

function Footer() {
    return (
        <footer>
            <h2  data-translate-key="credits">&copy; 2023 Your Company. All rights reserved.</h2>
            <nav>
                <Link to="/about-us"><p  data-translate-key="aboutUs">About Us</p></Link>
                <div class="contact">
                    <p data-translate-key="aboutUs">Numéro de téléphone : 06 92 69 26 02</p>
                    <p data-translate-key="aboutUs">Propriétaire : Rey Crusty</p>
                    <p data-translate-key="address">Adresse : 1 Crusty Caliente Pizza Del Pollo, Barbès 75018</p>
                </div>
            </nav>


        </footer>
    );
}

export default Footer;
